        String lastLetterSound = word.substring(word.length()-1);
        String middleOfWord = word.substring(1, word.length()-1);
        if(middleOfWord.contains(firstLetterSound)){
            soundPositionsFromSoundWordList.add(1);
        }
        if(middleOfWord.contains(lastLetterSound)){
            soundPositionsFromSoundWordList.add(2);
        }
        if(middleOfWord.contains(firstLetterSound)){

        }
        return soundPositionsFromSoundWordList;
